import React from 'react';

import './style.css';

export default function ModalCar({carObject}) {
    console.log(carObject); 
    return (
        <div style={style.parentDiv}>
            <div style={style.modalDiv}>
                
                
                <div style={style.headerModal}>
                    <h2>Carro</h2>
                    <a style={style.modalButton} onClick={()=>alert("Clicou")}>X</a>
                </div>
                <div style={style.HeaderModalContent}>
                    <p style={style.headerModalLine}></p>
                    <p style={style.headerModalText}>Marca: {carObject.car_manufacturer}</p>
                </div>

                <div style={style.HeaderModalContent}>
                    <p style={style.headerModalLine}></p>
                    <p style={style.headerModalText}>Modelo: {carObject.car_model}</p>
                </div>

                <div style={style.HeaderModalContent}>
                    <p style={style.headerModalLine}></p>
                    <p style={style.headerModalText}>Nome: {carObject.car_name}</p>
                </div> 

                <div style={style.HeaderModalContent}>

                    <p style={style.headerModalLine}></p>
                    <p style={style.headerModalText}>Combust√≠vel: {carObject.car_fuel}</p>
                </div>
                <p style={style.headerModalLine}></p>


            </div>
        </div>
    )
};

const style = {
    parentDiv: {
        backgroundColor: "rgb(163, 163, 163,0.8)",
        position: "absolute",
        zIndex: 10,
        width: "100%",
        height: "100%",
        display:"flex",
        justifyContent: "center",
        alignItems: "center"
    },

    modalDiv:{
        backgroundColor:"#fffafa",
        width:"50%", 
        height: "50%"
    },

    modalButton:{
        fontSize:"15px",
        backgroundColor:"#ffc9c9",
        borderRadius: "10px 10px",
        position: "relative",
        top:"-4px",
        left:"40%",
        color:"#525252"
    },

    headerModal:{
        backgroundColor:"#ff8f8f",
        display:"flex",
        justifyContent: "center",
        alignItems: "center",
        width:"100%", 
        height: "20%",
    },
    HeaderModalContent:{
        height:"20%"
    },
    headerModalText:{
        display:"flex",
        fontSize:"18px",
        padding:"10px 2%",
        justifyContent: "left",
        fontFamily: "Arial"
    },

    headerModalLine:{
        backgroundColor: "pink",
        width: "100%",
        height: "4px",
        marginTop: "0px"
    }

};
